import './styles/App.css';
import Form from "./Form.js";
import Login from './Login.js';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/" exact element={<Form />}/>
        <Route path="/login"  element={<Login />} />
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
